INSERT INTO `client` VALUES (27,'Ana','Feria González',NULL,NULL,NULL,'amferia@gmail.com',NULL,'fmale','1982-06-24','2023-10-10 15:21:03',4,NULL,'PILATES MÁQUINA\r\n\r\nEnfermedad reumática no diagnosticada, ursa con año y medio de evolución con corticoide (actualmente no)\r\nAfectación miembros superiores\r\nDIASTASIS abdominal de 5cm (parto hace 4 años)\r\n\r\n1 almohadilla\r\nCorregir abombamiento abdominal \r\nCorregir posición de los isquiones cuando trabajamos en sacro (molestias lumbares)','enable','false',-90,0,0,NULL,'2023-10-10 14:21:03','2024-04-30 23:00:12'),(28,'Elisabeth','Escobar Ferrer -Fisioterapia-',NULL,NULL,NULL,'10elisabeth85fisio@gmail.com',NULL,'fmale','1985-06-10','2023-10-10 15:37:41',1,NULL,'POSIBLE SD. DE EHLER DANLOS / POSIBLE DX MIOPATÍA\r\n\r\nAntecedentes:  Lx de muñeca, tendinopatía piramidal izquierda, luxación cadera izquierda. Dolor de cuello y dorsales. Dolor generalizado y cambiante.\r\n\r\n10/10/23 Refiere mejoría general. Molestia bíceps D.\r\n13/10/23 Molestia empeine D, sobrecarga IQ, zona suprarrotuliana y gemelos\r\n07/11/23 Continúa molestias de tobillos y sobrecarga MMSS\r\n\r\n\r\n\r\n14/02/24: refiere sobrecarga glútea y molestia en sacro durante las horas de trabajo. Empieza a tomar pregabalina.','enable','false',0,0,-2,NULL,'2023-10-10 14:37:41','2024-04-30 23:00:12'),(29,'Ana','Mencías Hurtado',NULL,NULL,NULL,'amenhur@gmail.com',NULL,'fmale','1976-12-20','2023-10-10 15:41:56',4,NULL,'PILATES MÁQUINA\r\n\r\nAntecedentes: Escoliosis (dorsal D, lumbar I)\r\n\r\nObservaciones: Debilidad abdominal. Corregir posición escapular','enable','false',-87,0,0,NULL,'2023-10-10 14:41:56','2024-04-30 23:00:12'),(30,'Aarón','Báez Ortega',NULL,NULL,NULL,'aaronperez1985@gmail.com',NULL,'male','1981-09-09','2023-10-11 11:01:37',1,NULL,'04-10-2022:  Diagnóstico- Discapacidad Intelectual del 75%. Retraso en desarrollo Psicomotor, lenguaje y Psicomotricidad. Empeoramiento motor-psicomotricidad en los últimos años. Alteraciones en la psicomotricidad fina y en la marcha, mal control de reflejos posturales y de tronco. Etiología no filiada.\r\nValoración: Entiende ordenes, no moviliza bien la pelvis y es inestable. Marcha con pies en RE y sin doblar rodillas. Buen control del tronco en sedestación. Inestabilidad en bipe, sobre todo el cuerpo se le va hacia atrás. hiperlordosis marcada.  \r\nTrabajar: 2 almohadillas, pero corregir mucho posición de la cabeza. Trabajar fuerza del glúteo medio, estabilidad y equilibrio sobre todo en Bipe, apoyo del antepié en deambulación, cierre de la base de sustentación, despegue del pie del suelo, braceo, mirada. no usar términos normales del Pilates','enable','false',-82,0,0,NULL,'2023-10-11 10:01:37','2024-04-30 23:00:12'),(31,'Abraham','Hernández Cruz',NULL,NULL,NULL,'a.hernandez1883@gmail.com',NULL,'male','1983-06-16','2023-10-11 11:19:19',5,NULL,'Patologías: RMN 2006 Angioma L3, extrusión Herniaria Posterior L5-S1; RMN 2016,protusiones l4-L5 (I) y L5-S1 (D). LUMBAR. Dolor en espalda tras trabajo, zona lumbar irradiada a tobillo izq.\r\nRODILLA: (D) distensión LLI, cambios degenerativos en menisco. (I) Condropatía rotuliana grado I, posibilidad de desgarro del menisco y distensión LLI. (En general no molestan).\r\nHOMBRO: lesión  (I) pero no molesta.\r\nValoración: fuerza abdominal, se puede trabajar bien con el, aunque cuidado con las lumbares.','enable','false',-39,-42,0,NULL,'2023-10-11 10:19:19','2024-04-30 23:00:12'),(32,'Agar','Villegas Garriz',NULL,NULL,NULL,'agarvg2@hotmail.com',NULL,'fmale','1972-05-18','2023-10-11 12:37:25',5,NULL,'15 octubre 2017: dolor hombro derecho con limitación. A veces sobrecarga Lumbar.','enable','false',0,-84,0,NULL,'2023-10-11 11:37:25','2024-04-30 23:00:12'),(33,'Ana Belén','Pérez Hernández',NULL,NULL,NULL,'anabelenph@gmail.com',NULL,'fmale','1976-10-31','2023-10-11 12:48:58',3,NULL,'10/02/2022: Lumbalgias esporádicas. sensación de tensión cervical constantes. Se marea con cambios de posición bruscos. Fumadora (sensación de falta de aire cuando está nerviosa).\r\nValoración: Sin almohadilla, enfatizar mirada en oblicuo. Debilidad abdominal pero ok en table top, no realiza roll up.','enable','false',-47,-42,0,NULL,'2023-10-11 11:48:58','2024-04-30 23:00:12'),(34,'Ana Cristina Ani','Rodríguez Perera',NULL,NULL,NULL,'ana.rodriguezperera@gmail.com',NULL,'fmale','1961-02-08','2023-10-11 13:02:32',4,NULL,'21/05/2021: Patologías: RODILLA (I) artrosis que a veces da dolor (medicada). LUMBAR, Artrosis, a veces episodios de ciática con ejercicios intensos. MUÑECA, quiste escafolunar dorsal, a veces mas prominente y no puede apoyar muñeca (I). PIE, Fx (I), le costó apoyar pero bien. HOMBRO, Calcificación tendón, hizo RHB. \r\nValoración: Lleva Audífonos, a veces parece despistada mirando al compañero por ello. 1 almohadilla. se puede trabajar bien con ella.','enable','false',0,-85,0,NULL,'2023-10-11 12:02:32','2024-04-30 23:00:12'),(35,'Alicia','Pérez Herrera',NULL,NULL,NULL,'aperher71@hotmail.com',NULL,'fmale','1971-11-24','2023-10-11 13:03:29',3,NULL,'Patologías: artroscopia de cadera derecha que no mejora el dolor. Dolor constante pero no hay limitación del movimiento.\r\nTiene dolor generalizado en espalda (por falta de movimiento) y normalmente de cabeza (hormonal).\r\nObservaciones: 1 almohadilla.','enable','false',-2,0,0,NULL,'2023-10-11 12:03:29','2024-04-30 23:00:12'),(36,'Alinson','Lima Zamora',NULL,NULL,NULL,'alinsonlima@yahoo.es',NULL,'fmale','1969-03-13','2023-10-11 13:06:42',2,NULL,'Patologías: rectificación cervical; artrosis cadera y rodilla; fascitis plantar pie derecho; glúteo derecho con dolor patente.\r\nObservaciones: ligero dolor de cuello en el ab-prep.\r\nDolor en el sacro con superficie dura durante el roll up y back.','enable','false',-76,0,0,NULL,'2023-10-11 12:06:42','2024-04-30 23:00:12'),(37,'Antonio','García Molina',NULL,NULL,NULL,'sinuhegmo@hotmail.com',NULL,'male','1978-11-13','2023-10-11 13:08:08',5,NULL,'09/01/2018: Patologías, LUMBAR, discopatía degenerativa L4-L5 con protrusión anular de predominio postero central y posterolateral. estrecha el espacio epidural (raíces L4). Irradiación hacia pierna derecha y suele adoptar posturas de desviación para huir del dolor. Escoliosis dorsolumbar derecha. \r\nValoración: 2023, sus lumbares ya no causan problema aparente durante las clases. CODOS, suele abrirlos comentando que \"sus codos están torcidos\", y no los extiende del todo, en realidad puede hacerlo cuando aproxima escápula y desenrolla hombros.','enable','false',-84,0,0,NULL,'2023-10-11 12:08:08','2024-04-30 23:00:12'),(38,'Ana María','Ramis Herrera',NULL,NULL,NULL,'agulo54@gmail.com',NULL,'fmale','1958-02-15','2023-10-11 13:10:10',2,NULL,'Patologías: cervical y dolor de oído (controlado).\r\nObservaciones: 2 almohadillas siempre barbilla al techo, mantiene las cervicales en extensión al bajar.\r\nLe cuesta entender aún la pelvis 12.\r\nEn reformer le cuesta ponerse las correas en los pies.\r\nSe le caen las piernas con ambas en table top.','enable','false',-83,0,0,NULL,'2023-10-11 12:10:10','2024-04-30 23:00:12'),(39,'Ana María','Álvarez García',NULL,NULL,NULL,'ysamag01@gmail.com',NULL,'fmale','1964-02-27','2023-10-11 13:13:36',3,NULL,'Patologías: hernia cervical; bursitis en caderas; protusión L3-L4; operada de varices; dolor de ingles\r\nArritmias leves, opresión en el pecho al realizar los ejercicios. Hombro izquierdo con tendinosis; Hernia cervical C5-C7. Suele tener calambres en las piernas.\r\nObservaciones: tiene 2 almohadillas.','enable','false',-81,0,0,NULL,'2023-10-11 12:13:36','2024-04-30 23:00:12'),(40,'Ayoze','Marrero Ramos',NULL,NULL,NULL,'ayozemarrero@gmail.com',NULL,'male','1982-01-03','2023-10-11 13:15:15',3,NULL,'26/04/2022: CERVICAL- DORSAL. Dolores Cervicodorsales con irradiación a cabeza frecuente y hormigueo a brazo izquierdo.\r\n25/05/2022: RODILLA (I) pequeña molestia en movimientos de laterales, no en flexo extensión.\r\nValoración: 1 almohadilla. Pierde P12 en puente de hombros. Corregir PIES en apoyo, tiende a perder LM o encoger dedos. dorso plano, le cuesta articular cervicodorsal. Se le olvida respirar. al estar cansado tiende a caerse las piernas en table top.\r\nPruebas diagnósticas: Se realiza una RM de columna cervical el 18/03/2024 y se observan cambios degenerativos con disco-osteofitarios, con protrusiones discales de C3 a C7 que condicionan cierta compresión anterior de la médula en estos niveles, sin mielopatía asociada sobre lo que se añade: en C3-C4 pequeña Protusión discal difusa, en C4-C5 Protusión discal asimétrica izquierda ocasionando una estenosis leve del canal medular, en C5-C6 Protusión discal difusa ocasionando una estenosis moderada del canal y formalina bilateral, en C6-C7 pequeña Protusión discal difusa.\r\n Informe evolutivo: 05/04/2024: Protusión discal difusa,C3-C7; Radiculopatía C5-C6','enable','false',-41,-41,0,NULL,'2023-10-11 12:15:15','2024-04-30 23:00:12'),(41,'Ángeles María','Díaz Pérez',NULL,NULL,NULL,'amdp68@hotmail.com',NULL,'fmale','1968-08-27','2023-10-11 15:04:07',1,NULL,'- Epicondilitis codo D (a veces le duele)\r\n- Fx TII (consolidada por caída) + protusiones/hernia T8-T9 y T9-T10\r\n-Dolor en cadera, rodilla (condromalacia) y pie D por caída \r\n-Lumbalgia que baja hacia la pierna D\r\n- TOC (ansiedad y depresivo), colon irritable (asocia todo¡as sus patologías al TOC)\r\n-Pérdidas de orina\r\n\r\n-2 almohadillas\r\n- Se olvida de todo, hay que volverle a explicar todo en cada clase, mucha paciencia (da la sensación de que pierde la memooria o no es capaz de procesar las órdenes)\r\n-Excesiva tensión muscular incluso en reposo, no sabe relajarse\r\n-Mala posición corporal (cabeza y pelvis)\r\n-Vigilar las respiraciones \r\n-Nada de línea media\r\n-Es muy visual, que te vea hacer el movimiento','enable','false',-79,0,0,NULL,'2023-10-11 14:04:07','2024-04-30 23:00:12'),(42,'Ana Lilia','Martín Rodríguez',NULL,NULL,NULL,'analiliamartin6@gmail.com',NULL,'fmale','1963-03-02','2023-10-11 15:10:19',3,NULL,'-Molestias en la región lumbar (no siempre; sobretodo al cargar peso, ponerse tacones), es soportable no toma tto antiinflamatorio cuando hay molestias\r\n-Dolores articulares oero no constantes\r\n-no hay dolores de cabeza de forma continua\r\n-Hernia discal L1-L2\r\n-Abombamiento discal de L4-L5\r\n-Osteoporosis a nivel lumbar (L2-L4)\r\n\r\n-1-2 almohadillas\r\n-No tensión en el cuello en ab-prep; sube bien hasta el borde ingerior de la escápula; hay tensión en el cuello en algunos ejercicios cuanddo implica las dos piernas en table top\r\n-Sobretodo tensa en cuello cn piernas en table top; vigilarla es muy aprensiva, corregirla mucho','enable','false',0,-79,0,NULL,'2023-10-11 14:10:19','2024-04-30 23:00:12'),(43,'Ángel','Arteaga Armas',NULL,NULL,NULL,'elmismoqueanaramis@gmail.com',NULL,'male','1959-02-23','2023-10-11 15:18:07',2,NULL,'-Marcapasos/Bypass\r\n-Diabetes / Tensión alta\r\n-Sindrome de la vaina de los rotadores del brazo D\r\n\r\n-2 almohadillas\r\n-Coge aire por la boca\r\n-Corre mucho, no sabe hacer P12 (no mueve pelvis, solo encoge barriga)\r\n-Pierde línea media\r\n-Acortamiento de isquios','enable','false',-83,0,0,NULL,'2023-10-11 14:18:07','2024-04-30 23:00:12'),(44,'Zita','Reina Borges',NULL,NULL,NULL,'zitareina@gmail.com',NULL,'fmale','1989-07-12','2023-10-11 15:22:07',4,NULL,'-Hernia discal L5-S1 (2008 Qx) desde julio 2022 nota más dolor y rigidez\r\n-Tiende a la TA baja, mareos cuando hay mucho calor\r\n-Le molestan un poco las muñecas al apoyo en cuadrupedia prolongado\r\n\r\n-Recordarle cerrar costillas y bajar pecho al soltar aire\r\n-Puente de hombros bien, sube a escápulas y puede poner table top (algún calambre ocasional)\r\n-Recordarle que baje hombros\r\n-Saca pecho y arquea corregir','enable','false',0,-1,0,NULL,'2023-10-11 14:22:07','2024-04-30 23:00:12'),(45,'María Zoraida','Hernández Fernández',NULL,NULL,NULL,'zoraidavioleta3@gmail.com',NULL,'fmale','1963-04-10','2023-10-11 15:27:17',3,NULL,'-Discopatía crónica sin compromiso radicular a niv