rra en supino, y en sedestación mas peso al izquierdo. Tensión en el cuello,  mira al techo y adelanta barbilla, aunque no se queja. enrolla y tensa hombros. Table top se va cansando y se le caen ligeramente, a parte de tener acortamiento en toda la cadena posterior y al estirar piernas desde table top sin arquear ya tiene molestas en lumbar. Empezamos las 5 sesiones privadas sin poder sentarse sobre isquiones e ir a sacro, ahora lo realiza pero con cuidado y poner COLCHONETA debajo, preguntarle mucho y vigilarla. Puente de hombros sube sin articular y necesita 3 o 4 muelles.','enable','false',-87,0,0,NULL,'2023-10-26 08:06:31','2024-04-30 23:00:12'),(162,'Felipe','Hormaechea Sánchez',NULL,NULL,NULL,'belagile1@gmail.com',NULL,'male','1962-06-23','2023-10-26 12:35:38',1,NULL,'-MALFORMACIÓN DE ARNOLD CHIARI TIPO 1-\r\n-Elevada afectación cervical: laminectomía C4-C5, lesión focal canal medular C3-C4, cambios degenerativos osteodiscales con afectación lateral izquierda C3-C4. Protusión discal postero central C4-C5. Complejo disco-osteofisario lateral izquierdo C5-C6-C7. Protusiones posterocentrales C7-D1-D2. Displasia cervicooccipital compleja. Displasia C1-C2\r\n-En 1985 Ictus VB con hemiparesia izquierda. Se Dx Mielopatía cervical transversa C3-C4\r\n- Marcha espástica. No hay buen control esfinteriano vesical y fecal. Distorsión visual\r\n- Espasticidad secundaria a tetraparesia espástica\r\n- Porta bomba intratecal de baclofeno. Le realizan revisiones y aumentan la dosis.\r\n- Deambula con ayuda de una muleta\r\n\r\nREHABILITACIÓN BASADA EN PILATES (3 veces en semana):\r\n- Usa taco de yoga para apoyo en DS. Puede levantar la cabeza levemente sin articular, no debe flexionar a nivel cervical.\r\n- Dificultad en la alineación de miembros superiores e inferiores. No mantiene la línea media\r\n- Afectación de la coordinación\r\n- Acumulación de gases en abdomen (requiere de tratamiento para vaciarlos)\r\n- Distonía abdominal\r\n- Los cambios de medicación le alteran todo el sistema. Más espasticidad, más dolor, más fatiga.\r\n- Fluctúa mucho su estado físico entre sesiones y en función de la medicación y espasticidad.  \r\n- Más afectación en MMII que MMSS, pero también presenta espasticidad en MMSS\r\n\r\nOBJETIVOS: \r\n- Trabajo de línea media\r\n- Activación musculatura glútea para favorecer la estabilidad y marcha\r\n- Ejercicios de coordinación\r\n- Activación musculatura abdominal (en función de la acumulación de gases)\r\n- Fortalecimiento musculatura erectora de columna y estabilizadores de escápula para compensar la hipomovilidad cervical\r\n- Movilidad pasiva de MMSS y MMII inhibiendo la espasticidad','enable','false',-116,0,0,NULL,'2023-10-26 11:35:38','2024-04-30 23:00:12'),(163,'Juana Rosa                     Juani','Ferraz Hernández',NULL,'42168334L',NULL,'jferrazhz@gmail.com',NULL,'fmale','1964-02-14','2023-10-26 13:58:14',3,NULL,'05/10/2022: PATOLOGÍAS, Hombro (D), calcificación blanda tipo III en subescapular. Anteriormente presentaba Impigement del tendón del supra, encontrarse varias calcificaciones en el tendón. Actualmente no dolor, con movilidad completa. Escoliosis dorsal de mas de 15 grados, aunque no se nota por que compensa con Lumbar.\r\nVALORACÓN: 2 almohadillas. Mentón alto y hombros enrollados. Le costó bastante P12-P6, vigilar por que compensa con mentón y hombros. MIEDO a la plancha Lateral por el Hombro.','enable','false',-37,-37,0,NULL,'2023-10-26 12:58:14','2024-04-30 23:00:12'),(164,'Julio','García San Luis',NULL,'42174408K',NULL,'julio.garcia.s@philips.com',NULL,'male','1973-07-17','2023-10-26 14:04:03',5,NULL,'PATOLOGÍAS: Cirugía hernia discal L5-L6 (limpieza). Protrusiones discales L1 a L3 y C3-C4. Cirugía Rodilla (D) Ligamento Cruzado y meniscos.\r\nJunio 2019. Fx codo-muñeca derecha. Dolor en hombro del mismo lado.','enable','false',0,-86,0,NULL,'2023-10-26 13:04:03','2024-04-30 23:00:12'),(165,'Lara','González Hernández',NULL,'79153474D',NULL,'laragonzalezhernandez@hotmail.com',NULL,'fma