co (SEDESTACIÓN)','enable','false',0,0,0,NULL,'2024-01-18 15:02:09','2024-04-30 23:00:12'),(368,'Ada','García Rodríguez -Fisioterapia-',NULL,NULL,NULL,'vgargart@gmail.com',NULL,'fmale','2009-02-27','2024-01-18 15:12:35',1,NULL,'11/07/23\r\nLesión rodilla D\r\nAntecedentes: luxación externa de rótula hace 9 meses con reducción externa. RMN. Cadera izq más alta (1,4cm)\r\nValoración: Displasia leve tróclea y edema lig PF medial. Pinzamiento femoropateral bilateral. Condropatía grado 2. Actitud escoliótica toracolumbar. Dolor cara interna rodilla. ECO: edema\r\nTratamiento: t. manual cara interna ext Q e IQ. Ej. isométricos de Q, isométrico glúteo e IQ y bici\r\n\r\nSeguimiento: \r\n27/12/23-. está haciendo bici 20 minutos cada día (L-V), 4x10 series Qm 4x15 glúteo e IQ. Terapia manual y ej aductor en DL, isométrico Q en pared y concéntricos (neutro, rot int, rot ext)\r\n09/01/24: Molestia coxis en puente, posiblemente de la bici. Continua 20\' bici + resto ej/diario. Recupera flex completa. \r\n1/2 tto manual/ 1/2 ej (glúteo, IQ, Q) resiste F + pelota\r\n15/01/24: aumenta bici a 30\', terapia manual 20\', resto ________ (cadena lateral, sentadilla con correas, trabajo gemelo),, triple flexión con R de F','enable','false',0,0,0,NULL,'2024-01-18 15:12:35','2024-04-30 23:00:12'),(369,'Francisco Javier','Fernández Rodríguez -Fisioterapia-',NULL,NULL,NULL,'franciscojavierfernandezrodriguez@fisioterapia.com',NULL,'male','1962-06-07','2024-01-18 15:24:47',1,NULL,'24/08/23\r\nMareos por cambios posturales, cualquier movimiento cervical (sensación de barco), bloqueada la movilidad cervical\r\nAntecedentes: protusiones lumbares (dolores ocasionales), molestias cervicales (emocional), dolor de cabeza (escasos)\r\nMedicación: enantyum para la lumbar\r\nValoración: limitación ROT, inclinación, flex/ext todo el ROM\r\nTratamiento: alta en octubre con la neuróloga. Tto manual, suboccipital y escápula, trapecios\r\n\r\nSeguimiento: \r\n04/09/23: más dolor lumbar, cuadrado izq aumenta