acia la pierna (I), se ha notado más  ágil  a la hora de girar en la cama y levantarse, los ejercicios  bien de pie, pero en supino sigue molestando bastante. \r\nHoy trabajamos  ambos lados más mov. Hacemos  estiramientos cadera post. sentadas con perna en una silla.\r\n05/03/24: Dice que le sigue doliendo pero camina mejor, se puede poner en supino, acaba de empezar con la bicicleta  estatático ( le molesta sillín y le  pone acolchado). Nota  los 2 lados  por igual, los estiramientos  bien. Bastante  mejor  en la  movilidad, trabajamos   en supino. el lado (D), aún se  resiente  un poco en las tensiones del tronco  le  mando ejercicios de movilidad y suelo pélvico con el Fitball.\r\n24/04/24: La espalda recuperada, molestia puntual al levantarse de la cama cuando se levanta por la mañana, del resto nada. Ha empezado a nadar, sigue caminando, con bici estática y los ejercicios pautados. Sufre caída hace 11 semanas, dolor en mano izq, en el médico le dicen que tiene una tendinitis en esa mano. Se cayó con la mano agarrada del lavabo. Hacerse una coleta, subirse los pantalones, todo eso le duele. Se ha puesto calor/frío, muñequera, paracetamol y no se le alivia. Valoramos con el ecógrafo, se ve inflamación en tabaquera anatómica, dolor a nivel de cara lat del pulgar y muñeca, dolor a la desviación cubital y extensión. Tratamos con terapia manual, mov mano/dedos/muñeca, Kinesio y pauta de ejercicios.\r\n07/05/24:  mejoría durante 1 semana con el vendaje; cuando se cayó volvió a dolerle, no puede hacer los ejer4cicios con peso. La irradiación a la muñeca se ha ido. Sigue habiendo inflamación en la zona de abductor de pulgar, extensor bien. Terapia manual, gel frío, adaptamos ejercicios y kinesio.\r\n17/05/24: vamos mejorando, ya el dedo lo puede mover y aplicar resistencia (aún peso no) la molestia es localizada en apófisis estiloides del cúbito. Se ve la inflamación disminuida en el ecógrafo. Terapia manual, mov de muñeca/pulgar, kinesio enfocado en estiloides.','enab