itales aumentados\r\n04/09/23: refiere contractura cervical. Valoración limitación RI hombro D, limitación cervical rotación e inclinación. Hipertono en inserción de infraespinoso. Trapecio D, ECOM. \r\n20/09/23: neuromodulación pointer hombro D, aumentado el deltoides y bíceps inflamado, molestia a la mov RE y RI\r\n29/11/23: tto escápula izq, trapecios hipertónicos, piramidal D hipertónico, dolor de cabeza\r\n27/12/23: dolor escápula izq y trapecio D aumentado, interescapular.\r\n26/02/24: dolor cara anterior cadera izquierda. Al pisar el embrague, en la fase de despegue, dormir tumbada de ese lado, al subir y bajar escaleras. También refiere episodio de inflamación abdominal. ECO: no se aprecia lesión. Posible pequeña bursitis. Dolor a la flexión de cadera en zona psoas y hacia trocánter. Terapia manual liberación del psoas y trocanter. Disminuye dolor al finalizar.\r\n\r\n06/03/24: tras tto respuesta inflamatoria y acude al hospital. Mejora a los días y hoy empeora. Tto manual ambas piernas. Centrado en recto anterior. Eco normal. Kinesiotape compresivo\r\n\r\n29/04/24: tortícolis aguda desde el día de ayer, con mareos, rigidez matutina. A la valoración dolor lado derecho y central cervical, limitación movilidad hacia el lado derecha.\r\n\r\n07/05/24: refiere mejoría, no c dolor de cabeza ni mareo. Pequeña molestia','enable','false',0,0,0,NULL,'2024-02-26 14:33:16','2024-05-07 14:34:35'),(475,'José Juaquín','García Jordan -Fisioterapia-',NULL,NULL,NULL,'jordanveterinario@gmail.com',NULL,'male','1970-08-04','2024-02-26 14:34:31',1,NULL,'26/02/24\r\n-Motivo de consulta: lumbalgias de repetición. L4 L5 s1 discopatías. Relación con estrés o ejercicio. Actualmente a la flexión de tronco.\r\nSe pone manta eléctrica y refiere mejoría.  Duerme bien y al despertar está peor. Durante el día y con la medicación mejora. \r\nDolor hace 5 días.\r\n\r\n-Antecedentes: \r\n- sobrepeso. En dos meses se opera.\r\n- baloncesto y ciclismo de joven.\r\nHace algo de bici actualmente y