s.','enable','false',0,0,0,NULL,'2024-02-26 15:27:10','2024-04-30 23:00:12'),(477,'Esperanza','Castro Machado -Fisioterapia-',NULL,NULL,NULL,'sadah.v@hotmail.com',NULL,'fmale','1990-07-19','2024-02-26 15:29:22',1,NULL,'27/09/2021\r\nMotivo de consulta: \r\nTalsalgia en ambos talones que irradia hacia la cara anterior de los talones. Dolor muy agudo (10 ene escala EVA), mejora; disminuye el dolor en el talón al comenzar la marcha. Espolón (?)\r\n26/02/2024: Cervicalgia lado derecho  de 1 semana de evolución que no mejora con calor ni AINE. Le molesta  al tragar. Limitación a la flexión  cervical y rotación derecha terapia manual ( Suboccipital y cérvico-dorsal)','enable','false',0,0,0,NULL,'2024-02-26 15:29:22','2024-04-30 23:00:12'),(478,'Víctor Manuel','García García-Fisioterapia-',NULL,NULL,NULL,'victormanuelgarciagarcia@fisioterapia.com',NULL,'male','1973-04-23','2024-02-26 18:08:23',1,NULL,'23/04/2019\r\nMotivo de consulta: \r\nMolestias en la zona cervical (habituales)Hace 3 semanas cervicalgias( urgencias-> Pinchazo)\r\nHernia (C4-C5 y Protusión (C5-C6)\r\nMirar escapulas\r\nOperado rodilla( menisco)\r\nAsma.','enable','false',0,0,0,NULL,'2024-02-26 18:08:23','2024-04-30 23:00:12'),(479,'Davinia','Rodríguez Acosta -Fisioterapia-',NULL,NULL,NULL,'daviniarodriguezacosta@fisioterapia.com',NULL,'fmale','2000-01-01','2024-02-27 10:20:53',1,NULL,'-Motivo: dolor antebrazo cara palmar y hace 1º dedo, quemazón, con el ordenador le duele, dolor a la actividad. \r\n-Seguimiento: \r\n01/12/23: dolor cervical D con irradiación hacia MS D, no hay dolor de cabeza ni mareos, 1 semana, a peor. Tto manual cervical, e inserción infraespinoso, inserción bíceps, ECO afectado supra leve, inflamación suboccipital, kinesio cervical + hombro','enable','false',0,0,0,NULL,'2024-02-27 10:20:53','2024-04-30 23:00:12'),(480,'Delia','Hernández González -Fisioterapia-',NULL,NULL,NULL,'delia.hernandez.64@gmail.com',NULL,'fmale','1997-09-12','2024-02-27 10:26:05',1,NULL,'28/11/23\r\n-Motivo de consulta: se levantó el domingo con dolor cervical lado D, rotar mucho el cuello le molesta\r\n-Antecedentes: nada relevante \r\n-Medicación: nada, se tomó un ibuprofeno el domingo, no le hizo mucho\r\n-Valoración: limitación del ROM a nivel cervical en lateroflex homolat, inclinación homolat y ext. Dolor a la palpación en erectores, trapecios, occipitales y escalenos. \r\n-Tratamiento: terapia manual, movilización cervical, estiramiento con frío','enable','false',0,0,0,NULL,'2024-02-27 10:26:05','2024-04-30 23:00:12'),(481,'Desiderio','Ávila Hernández -Fisioterapia-',NULL,NULL,NULL,'desiderioavila@gmail.com',NULL,'male','2000-01-01','2024-02-27 10:30:30',1,NULL,'16/05/23\r\n-Motivo de consulta: dolor en el brazo izq con hormigueo y pérdida de fuerza\r\n-Tratamiento: PS a nivel de redondo menor e infraespinoso + terapia manual de la zona escapular. Valoramos el antebrazo y no hay excesiva tonalidad ni hay puntos gatillos activos ni latentes\r\n-Seguimiento: \r\n05/09/23: contractura zona cervical, ECOM y escalenos, adormecimiento de manos sobre todo la izq. Neurodinamia en plexo braquial con bastante irritación del nervio radial. Movilización cervical, terapia manual. PGM en zona del pulgar lado palmar','enable','false',0,0,0,NULL,'2024-02-27 10:30:30','2024-04-30 23:00:12'),(482,'Dulce María','Pérez Hernández -Fisioterapia-',NULL,NULL,NULL,'delcemariaperezhernandez@fisioterapia.com',NULL,'fmale','1976-10-23','2024-02-27 10:37:37',1,NULL,'10/08/23\r\n-Motivo de consulta: accidente de tráfico, tirón cervical\r\n-Antecedentes: (ficha de pilates\r\n-Medicación: ninguna\r\n-Valoración: accidente de tráfico el día anterior, sin dolor aparente, hoy con dolor de cabeza y sensación de pesadez. Aumento del tono en zona de trapecios, sobre todo lado D y extensores cortos de cabeza. Zona de escalenos y ECOM con contractura sin irradiación. \r\n-Tratamiento: terapia manual, movilización cervical, estiramiento. Pauta de calor y estiramiento en casa.','enable','false',0,0,0,NULL,'2024-02-27 10:37:37','2024-04-30 23:00:12'),(483,'Elena María','Rodríguez Pereira -Fisioterapia-',NULL,NULL,NULL,'elenamariarodriguezpereira@fisioterapia.com',NULL,'fmale','1972-11-16','2024-02-27 10:51:25',1,NULL,'13/07/23\r\n-Motivo de consulta: dolor zona glúteo, psoas, lado D\r\n-Antecedentes: ver ficha pilates; fusión L5-sacro, condromalacia rotuliana\r\n-Medicación: flatoril, heipram\r\n-Valoración: zona glútea contracturada, hipertono general, contractura del psoas zona inserción distal, dolor en table tio; al subir y bajar la pierna. Zona de glútea media y cintilla ilitibial, con aumento del tono, dolor a la palpación\r\n-Tratamiento: terapia manual, pauta de ejercicios y estiramientos\r\n-Seguimiento: \r\n27/07/23: mejoría en cadera, más molestias en zona de cintilla iliotibial, glúteo medio y tensor de la fascia bien, Psoas dolorida más posibles agujetas en ADD. Terapia manual y estiramiento con frío\r\n17/08/23: Tto de psoas D masoterapia y estiramiento, add D. Abordaje manual y estiramiento. Dolor en codo, PS en desviador cubital del lado D, estimulación con pointer y neurodinamia (irritación del plexo)\r\n12/02/23: Tto de ADD Ds y psoas D, mejor el dolor de ABD D, estiramiento para casa, más dolor al ext. ADD\r\n06/02/24: se le está pasando el efecto del bloqueo lumbar, dolor en ABD/ADD/psoas y cuádriceps. Mejor los ABD y glúteo, peor los ADD (casi a nivel de pata de ganso). Posible Epitrocleitis en codo D, dolor al Flex muñeca contra resistencia, en la eco se ve inflamación. Hacemos terapia manual y EPI, pauta de ejercicios en casa.\r\n23/04/2024: Inflamación  en codo D hacia  epitroclea ( no es  epicondilalgia), zona  de flexiones de dedo y muñeca con  hipertono. Hacemos EPI, descarga manual, movilización radio- cubital. Próximo  día  repasamos  EPI. Revisamos  cadera(D) hipertono en cantilla iliotibial, mejor el tensor de la fascia lata. Movilidad mejor  ( especialmente la pasiva) con los ejercicios\r\n30/04/2024: Hoy ha estado peor  (inflamación en codo ) hace 2 días había estaco mejor durante la semana. Tratamos manual revisamos en Eco; solo se aprecia inflamación (peor zona del bíceps). A nivel de cadera tiene  hipertono pero el mayor dolor viene de la espalda( no le había dolido en tiempo atrás) tratamos a nivel manual, estiramos y pauto para casa.13/05/24: mejor que el día ant, codo con molestas localizadas hacemos EPI en zona de epitróclea (705mJ) bien tolerada, tto manual y estiramiento más kinesio. Zona de cadera más localizado el hipertono, espalda bien, psoas mejor. Mañana martes 14 le hacen pruebas para la cadera.','enable','false',0,0,0,NULL,'2024-02-27 10:51:25','2024-05-14 16:49:43'),(484,'Eva María','Navarro López -Fisioterapia-',NULL,NULL,NULL,'evam206@gmail.com',NULL,'fmale','1974-11-30','2024-02-27 10:59:05',1,NULL,'26/10/23\r\n-Motivo de consulta: dolor en gemelo izq (salto al cajón) dolor fuerte en el momento como si la hubieran pateado (ayer tarde)\r\n-Medicación: prednisona y dolquine (su tto habitual)\r\n-Valoración: como más cómoda está es caminando de puntillas, el apoyo sobre una superficie le molesta, revisada con ecógrafo pequeña microrotura fibrilar en gemelo int sin hematomas visibles ni derrames (pequeño hematoma los días anteriores), dolor al estiramiento en flexión plantar\r\n-Tratamiento: EPI en punto doloroso, drenaje linfático, movilización hacia flexión plantar y ligero estiramiento, kinesio con drenaje linfático, pauta de ejercicios en casa. Revisar en 1 semana\r\n-Seguimiento: \r\n02/11/23: mucho mejor, entra caminando mejor, apoyo con talón y buena respuesta al estiramiento. Sin dolor a la palpación. Terapia manual. EPI en la zona, sin edema. Pauta de ejercicios para casa y retorno progresivo a la actividad. \r\n14/12/23: rodilla izq en parte interna, solo en mov de RI de cadera y rodilla, no molesta al apoyar. ECO no se aprecia nada. Descarga cuádriceps/ADD\r\n06/02/24: dolor en brazo D desde el día ant, zona de deltoides y \"reflejo\" hacia el cuello. Dolor a la flexi