ajo (especialmente post)  pero  sin  inflamación  Dolor a las punta)\r\nTratamiento: Drenaje  linfático, Kinesio en pierna  ( se  le caer  con facilidad) EPI, en  tendón de Aquiles ( bien  tolerado) y en  gemelo ant. ( le  molesta  un poco  pauta  de ejercicios para casa ( control rotar )\r\n-Seguimiento: \r\n09/05/24: no ha podido hacer los ejercicios, le duele contraer el gemelo, tensión a nivel de media pierna hacia talón. El edema ha mejorado; él se nota menos hinchado sobre todo por las mañanas. El dolor de gemelo int bien, a nivel de ecógrafo el tendón está difuso. Las molestias está localizadas en parte proximal del gemelo ext y zona intravientre muscular. Ponemos kinesio, terapia manual, estiramiento analítico y con frío. Adaptamos los ejercicios (más isométricos y estiramiento).\r\n15/05/24: ha hecho los nuevos ejercicios pero sigue con mucho dolor, las puntas son imposibles. dolor en zona de gemelo ext y zona intergemelar pero al apoyar lo que nota es tendón. Edema mejor. Pisa plano; trabajamos fases de la marcha. EPI en tendón (2 agujas 1.000 mJ por cada una), se nota difuso en comparación con el D. Terapia manual, mov de tobillo izq. Trabajamos en reformer muelle amarillo (empuje monopodal con punta y estiramiento, empuje bilateral) nota dolor al empujar en punta pero podemos trabajar en cierto rango.','enable','false',0,0,0,NULL,'2024-05-03 18:12:07','2024-05-15 16:53:07'),(763,'Kenay','Ravelo Perdomo',NULL,NULL,NULL,'emailmelissaperdomo@fisioterapia.com',NULL,'male','2006-10-01','2024-05-07 13:49:45',1,NULL,'Primera sesión 27/07/23\r\n\r\nMotivo de consulta: dolor cervical, dorsal y lumbar lado izquierdo. Molestia zona sacra\r\nValoración: \r\nMovilidad cervical ok con molestias\r\nMov. hombros conservada\r\nDolor a la extensión de cadera\r\n\r\nTratamiento: terapia manual de baja intesidad. Tabla de ejercicios\r\n\r\n23/08/23: gran mejoría. Molestia sacroiliaca D en apoyo monopodal. Tto manual y epicódilo lateral derecho\r\n\r\n06/05/24: refiere dolor