Seguimiento: \r\n14/05/24: mejora de la movilidad cervical. Terapia manual + diatermia','enable','false',0,0,0,NULL,'2024-05-14 17:03:53','2024-05-14 17:03:53'),(783,'María Del Rosario','Báez Cejas -Fisioterapia-',NULL,NULL,NULL,'rosaba51@hotmail.com',NULL,'fmale','2000-01-01','2024-05-14 18:27:06',1,NULL,'02/05/23\r\n-Motivo de consulta: dolor hace 1 año aprox en ambos trocánter, más por la mañana. Ahora dolor glúteo más D y máx, irradia a isquiotibial (Adjunto informe). \r\n-Antecedentes: trocanteritis bilateral por tendinitis glúteo medio y edema peritrocantérico. Rotura labrum izq: anterosuperior y lesión inserción del tendón glúteo medio sugestivo de tendinitis. Pulgar izq. Resorte e inflamación articulación MTCF. \r\n-Medicación: infiltración glúteo medio ambas caderas (09/05/23)\r\n-Seguimiento:\r\n11/05/23: caderas mejor de dolor. Infiltran cadera D el día 16/05/23. Próximo día ver si empezamos por dedo, lumbar o piernas. \r\n18/05/23: duele al día siguiente cadera izq (la 1º infiltración) y dedo (prefiere no tocar). Tto lumbar/dorsal/cervical; se va de viaje viernes. \r\n06/06/23: traté espalda general, no quiere que toque caderas, mañana tiene trauma. Traté pulgar izq\r\n14/06/23: potenciar glúteo y glúteo medio y estirar (no tocar cadera). Se vuelve a hacer inflamacion porque solo le duran 15 días el efecto. TTo dedo izq resorte. Tabla ejercicios\r\n22/06/23: dedo igual (izq), infiltración agosto, lumbo-sacro-piramidal repaso, ejercicios no tiene banda\r\n28/06/23: está de las caderas fatal. Brazo/dedo izq EPI, kinesio\r\n20/12/23: desde jueves dolor cuello izq sin irradiación a cabeza, ni mareos, ni irradia MMSS. Masoterapia trapecios, dorsal, tracción, estiramiento\r\n13/05/24: dolor cervical desde que volvió de viaje (estrés). TM. Continúa con dolor en caderas pero le ha dado un respiro (al tomar enantyum para otra cosa). Va a probar con un nuevo tto \"resonancia terapéutico\".','enable','false',0,0,0,NULL,'2024-05-14 17:27:06','2024-05-14 17:27:06'),(784,'Luisa','López Izquierdo- Fisioterapia',NULL,NULL,NULL,'llopizqfisioterapia@gmail.com',NULL,'fmale','1969-04-02','2024-05-15 10:48:20',1,NULL,'fecha 15/09/2022 \r\nMOTIVO DE LA CONSULTA: dolor de uello ( anterior ECOM), ardor zona C7, dolor de cabeza hormigueo ambos brazos. \r\nANTECEDENTES: Bruxismo no usa férula, dolor de cuello crónico.\r\nMEDICACIÓN: ibuprofeno\r\nVALORACIÓN: Antepulsia cabeza, inflamación zona C7, Limitación inclinación y rotación\r\nTRATAMIENTO: TTO Manual, ECOM ambas escapulas. \r\nSEGUIMIENTO: \r\n25/03/23- dolor de cuello, dolor de cabeza. ATM, hormigueos hacia brazos, algún episodio de mareos. Terapia manual mas en los trapecios, escapulas, sacro.\r\n06/02/23: mareos, latigazo lado D con dolor de cabeza, trapecio D inflamado, no ATM \r\n15/02/23- esta peor, mucho estres, terapia manual trapecios y ECOM.\r\n08/03/23: mejoria, mantiene sobrecargas punctuales. tto manual, ATM.\r\n22/03/23- ATM, mejora movilidad y sobrecarga.\r\n13/04/23: rigidez cervical, menos dolor tto manual mas ATM.\r\n27/04/23- Dolor de cabeza, suboccipital dolor , ECOM, pitidos en oido.\r\n26/05/23- mas tensión en los trapecios, lado D. tto ATM mejora, ha tenido dolores de cabeza y mareos.\r\n02/06/23- baja el hipertono, mejora ATM mejora el estado en general, \r\n22/06/23: elevador mejora, mejoria ECOM.\r\n13/07/23- PS trapecio, P dolor de cuello y de cabeza, tto ATM mejoria PP, Subescapular: ECM, Dolor irradiado.\r\n27/10/23- Dolor de cabeza, mareos, mucho estres. TTO manual trapecios zona escapulas, interescapular.\r\n30/11/23- mucho estres, hipertonia trapecios, ATM d e I, interescapular D y escapulas.\r\n13/12/23- mejora hipertonia cervical y ATM.\r\n02/05/24- el día 30/04- practicando padel le dio un tiron en zona glutea D que se irradiaba hacia el isquio y molestia zona lumbar. Dolor al subir escaleras y caminar rapido. Dolor lumbar por la noche. TTO y estiramiento.\r\n16/05/24 mejoria en la zona glútea e iszuio D, dolor cervical. Terapia manual.','enable','false',0,0,0,NULL,'2024-05-15 09:48:20','2024-05-17 14:19:08'),(785,'Ángela Carmen','León Ramos - Fisioterapia',NULL,NULL,NULL,'angelacarmenleonramos@fiosioterapia.com',NULL,'fmale','1950-05-06','2024-05-15 10:50:54',1,NULL,'Fecha: 07/05/2024\r\n-Motivo de consulta: dolor de espalda zona baja y brazo izquierdo (sensación de hormigueo) y fue subiendo hacia arriba y ahora brazo izq hacia todos los dedos. Más vértigo este mes, medio mareo, zumbido de oídos\r\n-Antecedentes; 2019 Fx radio/cúbito izq (osteosíntesis). \r\n-Medicación: parche analgésico (ahora no mareos y cara roja), colesterol/HTA/azúcar (pastilla)/vértigo\r\n-Valoración: Rx cervical (rectificación)\r\n-Tratamiento: no punción; no le gusta, dejó de ir a otro sitio por ello. TM infraespinoso izq/redondo izq/dorsal y cervical bilateral, kinesiotaping izq, tracción/estiramiento','enable','false',0,0,0,NULL,'2024-05-15 09:50:54','2024-05-15 19:10:05'),(786,'Elena','Lavín Rodríguez- Fisioterapia-',NULL,NULL,NULL,'lavinrodriguez@gmail.com',NULL,'fmale','1975-08-31','2024-05-15 10:53:00',1,NULL,'Fecha: 14/05/2024\r\n-Motivo de consulta: dolor por caída hace una semana en espalda, rodilla D, hombros, muñecas y tobillo D. \r\n-Antecedentes: fisura manguito rotadores D antigua, cifosis/escoliosis, accidentes tráficos muchos y caídas (muchas), aplastamientos vertebrales cervical a lumbar. \r\n-Medicación: antiinflamatorio\r\n-Valoración: muy inflamada, muy dolorida, le entraban náuseas y mareos\r\n-Tratamiento: TM lumbar/dorsal/cervical. Mandé mov hombros/escápulas/cuello','enable','false',0,0,0,NULL,'2024-05-15 09:53:00','2024-05-15 17:25:21'),(787,'Cristo','Di Del Pino Paredes- Fisioterapia-',NULL,NULL,NULL,'cddelpino@outllook.con',NULL,'fmale','1976-09-14','2024-05-15 11:00:50',1,NULL,'Fecha: 08/03/2024\r\n-Motivo de consulta: dolor y molestia. Zona lumbar y centro, dorsal D/hombro lleva 2 semanas (estaba de baja y empezó a trabajar). Nota más dolor por el día. \r\n-Antecedentes: lumbalgia en otras ocasiones, HTA\r\n-Medicación: HTA, antihistamínicos, ha tomado analgésicos para el dolor\r\n-Valoración: lleva peor el paso de flexión a extensión y viceversa. Hipertono general de erectores de columna, más el lado D. Contractura en cuadrado lumbar, subescapular y romboides, mucha tensión en suboccipitales (tiene mareos)\r\n-Tratamiento: terapia manual, mov cervical/lumbar, kinesio\r\n-Seguimiento:\r\n14/05/24: ha bajado el tono muscular del cuello, pero sigue con molestas (menos mareos). PS en ambos trapecios (peor el D) y estimulación con pointer, buena respuesta y más espasmos en el izq. Terapia manual en piramidal y cuadrado lumbar D, estiramiento de lumbar, psoas y piramidal. Pauta de ejercicios para casa.','enable','false',0,0,0,NULL,'2024-05-15 10:00:50','2024-05-15 17:19:24'),(788,'Sergio','Del Castillo  Rojas',NULL,NULL,NULL,'sercadi@hotmiail.es',NULL,'male','1969-11-17','2024-05-15 12:32:46',1,NULL,'Fecha 15/05/2024\r\n-Motivo de consulta: dolor general espalda más comenzando lumbar irradia pierna D más rodilla parte interna (meses). Posible aplastamientos caidas alturas hace 10 años aprox. \r\n-Medicación: pastilla colesterol\r\n-Tratamiento: TM lumbar/ dorsal, psoas isométrico/bombeo, kinesio','enable','false',0,0,0,NULL,'2024-05-15 11:32:46','2024-05-15 17:21:32'),(789,'Carolina','Anceaume Pérez -Fisioterapia-',NULL,NULL,NULL,'anceaume.carolina@gmail.com',NULL,'male','1989-08-05','2024-05-15 18:27:37',1,NULL,'15/05/24\r\n-Motivo de consulta: dolor rodilla izq (cintilla iliotibial), y mano izq tras caída\r\n-Tratamiento: EPI cintilla, EPI zona cubital, diatermia cervical','enable','false',0,0,0,NULL,'2024-05-15 17:27:37','2024-05-15 17:27:37'),(790,'Sheila','Del Castillo Déniz -Fisioterapia-',NULL,NULL,NULL,'sheiidelcastillo@gmail.com',NULL,'fmale','2002-03-24','2024-05-15 20:02:27',1,NULL,'15/05/24\r\n-Motivo de consulta: dolor lumbar irradia a pierna izq hasta rodilla máxima\r\n-Antecedentes: 4 caídas (última caída hace 6 años aprox), desvío coccix, quieren unidad del dolor o cirugía. Hernia lumbar L5-S1 o L4-L5. \r\n-Medicación: no alergias ni medicación\r\n-Valoración: pierna izq más larga, psoas izq acortado\r\n-Tratamiento: diatermia sacro/lumbar/piramidal/psoas','enable','false',0,0,0,NULL,'2024-05-15 19:02:27','2024-05-15 19:02:27'),(791,'Raquel','García Sabina-Fisioterapia',NULL,NULL,NULL,'raquelgarciasabina@fisioterapia.com',NULL,'fmale','1995-12-16','2024-05-17 14:54:28',1,NULL,'MOTIVO DE LA CONSULTA: dolor cervical, se le duermen ambos brazos, anoche tuvo vertigo.\r\nANTECEDENTES: padece de cervicales y vértigo, escoliosis leve desde la adolesencia.\r\nVALORACIÓN: PGM trapecios D y lumbar I \r\nTRATAMIENTO: terapia manual espalda y diatermia.','enable','false',0,0,0,NULL,'2024-05-17 13:54:28','2024-05-17 13:54:28'),(792,'José Luis','Mariño Reino- Fisioterapia-',NULL,NULL,NULL,'joseluismarinoreino@fisioterapia.com',NULL,'male','1960-09-28','2024-05-21 09:56:58',1,NULL,'Fecha. 21/05/2024\r\n\r\nDolor de codo derecho de 2 semanas de evolcuiön. Lo asocia a nadar con palas. Inflamación inserción tríceps. Eco: posible rx epicondileo. No consigue extensión completa de codos por fx ambos de pequeño. Dolor a la extensión de muñeca y avd. Tto manual. Pico de artrosis en codo.','enable','false',0,0,0,NULL,'2024-05-21 08:56:58','2024-05-21 11:07:27'),(793,'José Carlos','Baute González-Fisioterapia-',NULL,NULL,NULL,'bauteglez@gmail.com',NULL,'male','1990-10-28','2024-05-21 10:23:44',1,NULL,'Fecha 16/05/2024-\r\nMOTIVO DE LA CONSULTA: lleva meses con sobrecarga cuello/dorsal, irradiación a brazo derecho, no dedos, no mareos, no dolor de cabeza.\r\nVALORACIÓN: Pierna izq ligeramente, mas carga. Sobrecarga tambien manual dorsal cervical con diatermia 60% 30 min.','enable','false',0,0,0,NULL,'2024-05-21 09:23:44','2024-05-22 11:14:11'),(794,'Marianela','Santos Solenzal',NULL,NULL,NULL,'santosmaianela72@gmail.com',NULL,'fmale','1974-12-11','2024-05-21 10:27:50',1,NULL,'Fecha:16/05/2024\r\nMOTIVO DE LA CONSULTA: dolor escapula D , endurecimiento manos y piernas.\r\nANTECEDENTES: operada visceral (no explica bien)\r\nMEDICACIÓN: NO\r\nTRATAMIENTO: Tto manual región escapular y suboccipital,','enable','false',0,0,0,NULL,'2024-05-21 09:27:50','2024-05-22 11:18:22'),(795,'José María','Manso Vega-Fisioterapia-',NULL,NULL,NULL,'jmansocercaten@gamil.com',NULL,'male','1946-10-03','2024-05-21 10:48:46',1,NULL,'Fecha:20/05/2024\r\nMOTIVO DE LA CONSULTA: dolor contnuo, NO caida.,+ a pie quieta, sin irradiación.\r\nANTECEDENTES: caída escaleras, fx a nivel lumbar (pinzamientos 2 vertebras), varias hernias lumbares\r\nTRATAMIENTO: diatermia 30 min lumbar manos libres 50. TTO lumbar, psoas/ piramidal.','enable','false',0,0,0,NULL,'2024-05-21 09:48:46','2024-05-22 11:27:51'),(796,'Elisa María','Cardila Chinchilla -Fisioterapia-',NULL,NULL,NULL,'chinchi-83@hotmail.com',NULL,'fmale','1983-11-10','2024-05-21 10:52:20',1,NULL,'Fecha:20/05/2024','enable','false',0,0,0,NULL,'2024-05-21 09:52:20','2024-05-21 09:52:20'),(797,'Guillermo  F','Martín Goméz -Fisioterapia--',NULL,NULL,NULL,'martingomez.guillermo@gmail.com',NULL,'male','1982-11-11','2024-05-21 18:06:59',1,NULL,'Fecha: 21/05/2024\r\nMOTIVO DE LA CONULTA: desde hace 1 mes dolor antebrazo izq. sin llegar a dedos. f...........sintió algo en el brazo. Entrena con pesas. \r\nANTECEDENTES: hombros lesionados hace 2 años, codo derecho hace años.\r\nTRATAMIENTO: diatermia antebrazo 60% 15 min, estiramiento y tto manual, punción seca y electroestimulación.','enable','false',0,0,0,NULL,'2024-05-21 17:06:59','2024-05-22 11:49:43'),(798,'José Miguel','Cabrera Amador',NULL,NULL,NULL,'tallerplaza@hotmail.es',NULL,'male','1982-03-20','2024-05-21 18:39:16',1,NULL,'Fecha:20/03/2023','enable','false',0,0,0,NULL,'2024-05-21 17:39:16','2024-05-21 17:39:16'),(799,'Encarnación','Chinchilla Ruiz',NULL,NULL,NULL,'chinchi_83@hotmail.com',NULL,'fmale','1951-03-26','2024-05-24 13:33:08',1,NULL,'Fecha 24/05/2024','enable','false',0,0,0,NULL,'2024-05-24 12:33:08','2024-05-24 12:33:08'),(